        try {
            fetch("http://localhost:5000/api/user/letolt?nev=${userN}&pass=${userP}" ,
          { method: "GET",
            headers: {
            Accept: 'application/json',
            'Content-Type': 'application/json',
            }}).then(() =>
          {
            console.log(userN);
            console.log(userP);
            //window.location.reload();
        });
        } catch (error) {
            console.log(error)
        }
        
      }
    
    return(
        <form>
            <input type="text" id="nev" placeholder="felhasználónév..." name="nev"/>
            <input type="password" id="password" placeholder="jelszó..." name="password"/>
            <button onClick={(e) => checkLogin()} >Login</button>
            
        </form>
    );
}
export default Login;
